BEGIN TRANSACTION;

CREATE TABLE IF NOT EXISTS "Currencies" (
	"ID"	INTEGER NOT NULL,
	"NameCode"	TEXT NOT NULL,
	"FullName"	TEXT NOT NULL,
	"Country"	TEXT NOT NULL,
	"BaseExchangeUSD"	INTEGER NOT NULL,
	"Symbol" TEXT NOT NULL
);
CREATE TABLE IF NOT EXISTS "Exchanges" (
	"ID"	INTEGER NOT NULL,
	"CurrAID"	INTEGER NOT NULL,
	"CurrBID"	INTEGER NOT NULL,
	"ExchangeName"	TEXT NOT NULL,
	"BaseExchangeRate"	INTEGER NOT NULL
);

COMMIT;
